description:
The Bootleg Series Volumes 2 is a compilation set by Bob Dylan, issued on Columbia Records, catalogue C3K 86572. It is the first installment in the Dylan bootleg series. It has been certified with a gold record by the RIAA as of August 1997, and peaked at #49 on the Billboard 200 and #32 in the UK.

